import React from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
} from "reactstrap";
import logo from "../../images/logo.png";
import style from "./Header.module.css";
import { Link, animateScroll as scroll } from "react-scroll";

export default class Example extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false,
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen,
    });
  }

  scrollToTop = () => {
    scroll.scrollToTop();
  };

  render() {
    return (
      <>
        <Navbar light expand="md" fixed="top">
          <NavbarBrand href="/" c>
            <img
              src={logo}
              alt="Logo"
              className={style.logo}
              onClick={this.scrollToTop}
            />
          </NavbarBrand>
          <NavbarToggler onClick={this.toggle} className={style.toggler} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem className={style.nav}>
                {/* <Link
                  style={{ color: "black", fontWeight: "bold" }}
                  activeClass="active"
                  to="home"
                  spy={true}
                  smooth={true}
                  offset={-200}
                  duration={500}
                >
                  HOME{" "}
                </Link> */}
              </NavItem>
              <NavItem className={style.nav}>
                <Link
                  style={{ color: "black", fontWeight: "bold" }}
                  activeClass="active"
                  to="tour"
                  spy={true}
                  smooth={true}
                  offset={-200}
                  duration={500}
                >
                  TOUR{" "}
                </Link>
              </NavItem>
              <NavItem className={style.nav}>
                <Link
                  style={{ color: "black", fontWeight: "bold" }}
                  activeClass="active"
                  to="music"
                  spy={true}
                  smooth={true}
                  offset={-200}
                  duration={500}
                >
                  MUSIC{" "}
                </Link>
              </NavItem>
              <NavItem className={style.nav}>
                <Link
                  style={{ color: "black", fontWeight: "bold" }}
                  activeClass="active"
                  to="merch"
                  spy={true}
                  smooth={true}
                  offset={2000}
                  duration={500}
                >
                  MERCH{" "}
                </Link>
              </NavItem>
              <NavItem className={style.nav}>
                <Link
                  style={{ color: "black", fontWeight: "bold" }}
                  activeClass="active"
                  to="contact"
                  spy={true}
                  smooth={true}
                  offset={2000}
                  duration={500}
                >
                  CONTACT
                </Link>
              </NavItem>
              <div id="social">
    <ul>
    <li><a href="https://www.facebook.com/LIKE4B/" target="_blank"><img src="images/social/facebook.png"/></a></li>
    <li><a href="https://www.instagram.com/dj4b/" target="_blank"><img src="images/social/instagram.png"/></a></li>
    <li><a href="https://www.youtube.com/user/THEREALDJ4B/videos" target="_blank"><img src="images/social/youtube.png"/></a></li>
    <li><a href="https://twitter.com/DJ4B" target="_blank"><img src="images/social/twitter.png"/></a></li>
    <li><a href="https://soundcloud.com/dj4b" target="_blank"><img src="images/social/soundcloud.png"/></a></li>
<li><div id="fleft"><iframe src="https://embed.spotify.com/follow/1/?uri=spotify:artist:0LIl9fjMPEZp8UDiL8Yuo4&amp;size=basic&amp;theme=light&amp;show-count=0" width="100" height="25" scrolling="no" frameborder="0" style="border:none; overflow:hidden;" allowtransparency="true"></iframe></div></li>

    </ul>
    </div>
            </Nav>
          </Collapse>
        </Navbar>
      </>
    );
  }
}
